import React from 'react'

const Rating = ({val, text}) => {
  return (
    <div>
        <span>
            <i>className={val >= 1 ? 'fas fa-star': val >= 0.5 ? 'fas fa-star-half-alt' : 'fas fa-star'}</i>
        </span>
    </div>
  )
}

export default Rating
